import Age from "./age";

export default class Welcome extends React.Component {
  render() {
    const { name, age } = this.props;

    return (
      <div>
        <p>Welcome, {this.handleState}!</p>
        {age > 18 ? <Age age={age} /> : "You are very young!"}
      </div>
    );
  }
}
